record.field:
for record in self:

  if 'move_line_ids_without_package' in self._fields:
    for precio in self.move_line_ids_without_package:
      record['x_studio_total_entrega_iva'] += precio.sale_price
  else:
      record['x_studio_total_entrega_iva'] = 1.0

for record in self:
  qty_sum = sum(line.product_uom_qty for line in record.order_line)
  del_sum = sum(line.qty_delivered for line in record.order_line)
  if del_sum == 0:
      record['x_studio_delivery_status'] = "Por Surtir"
  elif qty_sum > del_sum:
      record['x_studio_delivery_status'] = "Parcial"
  else:
      record['x_studio_delivery_status'] = "Surtido"

for record in self:
  if record['x_studio_estado_de_traslado'] != "done":
    record['x_studio_float_field_gGjOw'] = record['reserved_uom_qty'] * record['x_studio_precio_unitario']
  else:
    record['x_studio_float_field_gGjOw'] = record['qty_done'] * record['x_studio_precio_unitario']

for record in self:
  if record['x_studio_estado_de_traslado'] != "done":
    record['x_studio_costo_total_1'] = record['reserved_uom_qty'] * record['x_studio_costo_unitario']
  else:
    record['x_studio_costo_total_1'] = record['qty_done'] * record['x_studio_costo_unitario']

for order in self:
  if order.x_studio_one2many_field_mgef0:
    sumatoria_pagos = sum(order.x_studio_one2many_field_mgef0.mapped('x_studio_monto_og_1'))
    order['x_studio_sumatoria_pagos'] = sumatoria_pagos
  else:
    order['x_studio_sumatoria_pagos'] = 0

for order in self:
  if order.move_line_ids_without_package:
    costo_total = sum(order.move_line_ids_without_package.mapped('x_studio_costo_total_1'))
    order['x_studio_costo_total_traslado'] = costo_total
  else:
    order['x_studio_costo_total_traslado'] = 1

for order in self:
  if order.move_line_ids_without_package:
    venta_total = sum(order.move_line_ids_without_package.mapped('x_studio_float_field_gGjOw'))
    order['x_studio_venta_total_sin_iva'] = venta_total
  else:
    order['x_studio_venta_total_sin_iva'] = 1
